INSERT INTO `newspaper` (`news_id`, `news_name`, `news_date`, `news_heading`, `news_content`, `news_content2`, `lsedited`, `view`, `created_by`, `isDeleted`) VALUES
(1, 'ถ่ายรูปทำบัตรนักศึกษา รหัส 66', '2023-08-31', 'ประชาสัมพันธ์ นักศึกษาใหม่ รหัส 66 (เฉพาะนักศึกษา มทร.ล้านนา เชียงใหม่) ดำเนินการถ่ายรูปทำบัตรนักศึกษา', 'งานรับสมัครนักศึกษาใหม่ สำนักส่งเสริมวิชาการและงานทะเบียน ขอแจ้ง\n\nประชาสัมพันธ์ นักศึกษาใหม่ รหัส 66  (เฉพาะนักศึกษา มทร.ล้านนา เชียงใหม่)\n\nดำเนินการถ่ายรูปทำบัตรนักศึกษา ตามกำหนดการประจำปีการศึกษา 2566 ดังนี้  \n\n    กำหนดการถ่ายรูปทำบัตรนักศึกษา 2566\n\n  ', 'ระดับ ปวช. ปวส. ปริญญาตรี  ทรงผมและการแต่งกาย ดังนี้\n\nนักศึกษาชาย : ทรงผมสุภาพ (สีผมตามธรรมชาติ ไม่ปรกคิ้ว ด้านข้างไม่ปิดหู)\n\nไม่ไว้หนวด เครา หรือจอน แต่งกายชึดนักศึกษาถูกระเบียบ\n\nนักศึกษาหญิง : ผมทรงสุภาพ (สีตามธรรมชาติ ไม่ปิดหน้า ไม่ปรกคิ้ว ไม่ประบ่า )', '', 25, 'ขวัญชัย เอื้อวิริยานุกูล', 0),
(2, 'สวส.มทร.ล้านนา แนะนำบริการอินเตอร์เน็ต', '2023-08-29', 'สวส.มทร.ล้านนา แนะนำบริการ : บริการยืมต่อด้วยตนเองผ่านระบบอินเทอร์เน็ต (Online Renewal Service)', '', '', '', 5, 'ขวัญชัย เอื้อวิริยานุกูล', 0),
(3, 'สวส.มทร.ล้านนา แนะนำบริการเข้าใช้งานประตูอัตโนมัติของหอสมุด', '2023-08-29', 'สวส.มทร.ล้านนา แนะนำบริการ : ขั้นตอนการเข้าใช้งานประตูอัตโนมัติของหอสมุด มทร.ล้านนา', '', '', '', 5, 'ขวัญชัย เอื้อวิริยานุกูล', 0),
(4, 'สวส.มทร.ล้านนา แนะนำบริการ e-Mail RMUTL', '2023-08-29', 'สวส.มทร.ล้านนา แนะนำบริการ : e-Mail RMUTL สำหรับอาจารย์ บุคลากร และนักศึกษา มทร.ล้านนา', 'ช่องทางการเข้าใช้งาน : mail.rmutl.ac.th\nคู่มือการใช้งาน e-Mail : https://bit.ly/42O9sKp\nคู่มือการใช้งาน RMUTL Account : https://arit.rmutl.ac.th/news/22019\n......................................................\nUsername และ Password เพื่อเข้าใช้งาน\nสำหรับ', 'สำหรับนักศึกษา\nUsername : RMUTL Account ตามด้วย @live.rmutl.ac.th\nPassword : RMUTL Account\n(ตัวอย่าง e-Mail : xxx_66@live.rmutl.ac.th)\n\n......................................................\nสอบถามรายละเอียดเพิ่มเติม : งานพัฒนาระบบสารสนเทศ สวส.มทร.ล้านนา ', '', 3, 'ขวัญชัย เอื้อวิริยานุกูล', 0),
(5, 'สวส.มทร.ล้านนา แนะนำบริการ : Booking RMUTL', '2023-08-29', 'สวส.มทร.ล้านนา แนะนำบริการ : Booking RMUTL (ระบบจองห้องแบบออนไลน์)', 'ช่องทางการจองห้อง : https://booking.rmutl.ac.th', '', '', 1, 'ขวัญชัย เอื้อวิริยานุกูล', 0),
(6, 'สวส.มทร.ล้านนา (หอสมุด)', '2023-08-10', 'สวส.มทร.ล้านนา (หอสมุด) แนะนำบริการ : บริการห้องสำหรับนักศึกษา', 'ช่องทางการจองห้อง : คลิกที่นี่ ', '', '', 1, 'ขวัญชัย เอื้อวิริยานุกูล', 0),
(7, 'สวส.มทร.ล้านนา แนะนำบริการ พื้นที่จัดเก็บข้อมูล', '2023-08-06', 'สวส.มทร.ล้านนา แนะนำบริการ : Did you Know…พื้นที่จัดเก็บข้อมูล สำหรับบุคลากร และนักศึกษา มทร.ล้านนา OneDrive 5,000 GB (5 TB)', 'Username และ Password สำหรับใช้งาน คือ RMUTL Account', 'ช่องทางการเข้าใช้งาน : คลิกที่นี่ คู่มือการใช้งาน : คลิกที่นี่', '', 5, 'ขวัญชัย เอื้อวิริยานุกูล', 0),
